			<h1 class="entry-title ">编译出一个复兴前的rAthena</h1>

			<div class="entry-meta">
				<span class="posted-on"><i class="fa fa-calendar"></i> <a  rel="bookmark"><time class="entry-date published" datetime="2014-11-14T17:31:00+00:00">2014年11月14日</time><time class="updated" datetime="2015-03-15T17:28:47+00:00">2015年3月15日</time></a></span><span class="byline"> <i class="fa fa-user"></i> <span class="author vcard"><a class="url fn n" href="https://rathena.cn/">Sola丶小克</a></span></span>

		<div class="entry-content">
			<p>rAthena的服务端代码是同时兼容复兴前(pre-re)和复兴后(re)的。</p>
<p>默认情况下，rA会编译成复兴后(re)的版本，想编译成复兴前(pre-re)的版本，您只需要做出一点改动。</p>
<p><!-- more --></p>
<p>只需要在“<strong>src\config\renewal.h</strong>”中，将“<strong>//#define PRERE</strong>”前面的注释符“<strong>//</strong>”去掉，然后重新编译即可。</p>
